import { Fragment } from "react";

import Card from "../UI/Card/Card";
import classes from './BodyImages.module.css';

const BodyImages = () => {
  return (
    <Fragment>
      <div className={classes.images}>
        <Card>
          <img
            src="../../ssets/images/20220619_191909.jpg"
            alt="Ethan holding a dog"
          ></img>
        </Card>
        <Card>
          <img
            src="../../assets/images/20220627_231841.jpg"
            alt="Ethan holding a juice box"
          ></img>
        </Card>
      </div>
    </Fragment>
  );
};

export default BodyImages;
